export const Navbar = () => {
  return (
      <div className='navbar navbar-dark gb-dark mb-4'>
        <span className='navbar-brand'>
         Chinuli 
        </span>

        <button className='btn btn-outline-danger'>
          <i className='fas fa-sign-out-alt'></i>
          <span> Exit</span>
          </button>
      </div>
  )}
